import React, { Fragment, Component } from 'react';
import PaypalCheckout from "./PaypalCheckout";

function ShowPaypal() {
    const order = {
        customer: '123456',
        total: '550,00',
        items: [
            {
                sku: '112',
                name: 'camisa ReactJS',
                price: '300,00',
                quantity: 1,
                currency: 'MXN'
            },
            {
                sku: '99',
                name: 'camisa ReactJS',
                price: '300,00',
                quantity: 1,
                currency: 'MXN'
            }
        ]
    };

    return (
        <div>
            <PaypalCheckout order={order} />
        </div>

    );

}

export default ShowPaypal;
